script: |
  super -f text -I q4906.spq | sort > q4906.out

inputs:
  - name: q4906.spq
    data: |
      SELECT ALL col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 NOT BETWEEN NULL AND - - col0 * + ( + col1 ) * col1 + + + col0 + - 82 - 81;
  - name: tab0

outputs:
  - name: q4906.out
    data: |
      99
